import React from 'react';
import { BrowserRouter, Router, Route} from 'react-router-dom';
import App from './App';

class Day extends React.Component {
  render() {
    return (
      <div className="app">
        <h1 className='title'>Desember</h1>
        <BrowserRouter>
          <Router>
              <Route path="/" component={App} />
          </Router>
        </BrowserRouter>
      </div>

      );
    }
}



export default Day;
